import React from 'react';
import data from '../ProductsPage/data.json';

class ProductItems extends React.Component {

        render() {
            return(
            <div>
                {data.map((ItemInfo, index)=>{
                    return <h2>{ItemInfo.productDescription}</h2>
                }  ) }
            </div>
        )
    }
}

export default ProductItems;
